import React from "react";
import ReactDOM from "react-dom/client";

function APP() {
  return (
    <div>
      <h1>Welcome to the Pizza Menu</h1>
      <Pizza />
      <Pizza />
      <Pizza />
    </div>
  );
}

function Header() {
  return (
    <header>
      <h1>Pizza Menu</h1>
    </header>
  );
}

function Menu() {
  return (
    <div>
      <h2>Menu</h2>
      <ul>
        <li>Pizza Spinaci</li>
        <li>Pizza Margherita</li>
        <li>Pizza Focaccia</li>
      </ul>
    </div>
  );
}

function Footer() {
  return (
    <footer>
      <p>Copyright 2022</p>
    </footer>
  );
}

function Pizza() {
  return (
    <div>
      <img src="pizzas/spinaci.jpg" alt="Pizza spinaci" />
      <h2>Pizza</h2>
      <p>This is a pizza.</p>
    </div>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <APP />
  </React.StrictMode>
);
